  // border-collapse: collapse;\n}\n\ntable {\n  border-collapse: collapse;\n}\n\n.w300 {\n  width: 300px;\n}\n\n.center {\n  margin-left: auto;\n  margin-right: auto;\n}\n\n*,\n*::after,\n*::before {\n  margin: 0;\n  padding: 0;\n}\n\nbody {\n  overflow-y: hidden;\n}\n","@font-face {\n  font-family: 'Tetris2-VP0w';\n  font-display: swap;\n  src: url('../../assets/fonts/BUS-DISPLY-Regular.ttf.woff') format('truetype');\n}\n","@use '../../../public/css/contsants';\n\n.frame {\n  border-radius: 7%;\n  background-color: contsants.$base-color;\n  height: 75%;\n\n  min-height: 800px;\n  box-shadow: 0 0 30px rgba(0, 0, 0, 0.9), inset 0 0 15px rgba(0, 0, 0, 0.7);\n  justify-content: center;\n  display: flex;\n  align-items: center;\n  flex-direction: column;\n\n  aspect-ratio: 1 /2;\n\n  @include small {\n    min-width: 20rem;\n    background-color: red;\n  }\n}\n\ntr {\n  line-height: 0px;\n}\n\n.pauseBox {\n  min-width: 20vh;\n}\n","$base-color: dodgerblue;\n\n$button-color: #ecec24;\n\n$button-action-color: dodgerblue;\n","@mixin pads {\n  @media screen and (max-width: 768px) {\n    @content;\n  }\n}\n@mixin phones {\n  @media screen and (max-width: 350px) {\n    @content;\n  }\n}\n\n@mixin reader {\n  @media screen and (max-width: 420px) {\n    @content;\n  }\n}\n\n@mixin small {\n  @media only screen and (max-width: 300px) {\n    @content;\n  }\n}\n",".help {\n  width: 50%;\n  background: #f6f5f5;\n}\n\n.helpPanel {\n  display: flex;\n  align-items: center;\n  flex-direction: column;\n}\n",".next-piece-table {\n  font-size: 0;\n  padding: 15px 15px 15px 15px;\n  border-spacing: 0px;\n  margin: 10px 20px 20px 7px;\n  height: 20%;\n  width: 20%;\n  z-index: 3;\n}\n",".playground-table {\n  font-size: 0;\n  margin: 10px 10px 10px 20px;\n\n  height: 95%;\n  line-height: 0;\n  width: 100%;\n  max-height: 100%;\n  aspect-ratio: 1/2;\n  z-index: 3;\n}\n\n.cell {\n  font-size: 1rem;\n  margin: 0px;\n  padding: 0px;\n  min-width: 20px;\n  min-height: 20px;\n\n  width: 15px;\n 